import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Test from './component/Test'


function App() {
  return(
    <div>
      <Test />
    </div>
  )
}


ReactDOM.render(
  <App />,
  document.getElementById('root')
);
